import React, { Component } from "react";
import PropTypes from "prop-types";
import styled from "styled-components";

const LoginForm = styled.form``;
const InputId = styled.input``;
const InputPassword = styled.input``;

class LoginPresenter extends Component {
  render() {
    const { handleId, handleSubmit, id, password } = this.props;
    return (
      <LoginForm onSubmit={handleSubmit}>
        <InputId placeholder="please input ID" type="text"></InputId>
        <InputPassword placeholder="PASSWORD" type="password"></InputPassword>
      </LoginForm>
    );
  }
}

LoginPresenter.propTypes = {
  id: PropTypes.string.isRequired,
  password: PropTypes.string.isRequired,
  handleId: PropTypes.func,
  handleSubmit: PropTypes.func
};

export default LoginPresenter;
